import React from "react";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

const NewExpense = () => {
  return (
    <div className="new-expense">
      <button onClick={startEditingHandler}>Add New Expense</button>

      <ExpenseForm />
    </div>
  );
};

export default NewExpense;
